window.bookSummaryJSON = "<p>The shadow and I become one.</p> <p>Everything has changed, and the reflection in the mirror is almost unrecognizable. My soul mate, Alex, and our friends help to ground me.</p> <p>However, what I’d became still isn’t known and the abilities I have aren’t anything we’re familiar with.</p> <p>As our enemies become more desperate, they’re willing to sacrifice everything to force me to leave–even contacting a long-lost enemy to assist in eliminating me.</p> <p>We quickly learn that things aren’t what they seem and that my heritage alters everything.</p> <p>Including me.</p>"; 
